class LinearModel{constructor(){this.isFit=!1}}class LinearRegression extends LinearModel{constructor(){super(),this.m=0,this.b=0}fit(t,s){for(var i=0,r=0,h=0,e=0,n=0;n<t.length;n++)i+=t[n],r+=s[n],h+=t[n]*s[n],e+=t[n]*t[n];this.m=(t.length*h-i*r)/(t.length*e-Math.pow(Math.abs(i),2)),this.b=(r*e-i*h)/(t.length*e-Math.pow(Math.abs(i),2)),this.isFit=!0}predict(t){var s=[];if(this.isFit)for(var i=0;i<t.length;i++)s.push(this.m*t[i]+this.b);return s}}function joinArrays(){var t=[];if(6==arguments.length){t.push([arguments[0],arguments[2],arguments[4]]);for(var s=0;s<arguments[1].length;s++)t.push([arguments[1][s],arguments[3][s],arguments[5][s]])}return t}